import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './footer.css';
import {Container, Row, Col} from 'react-bootstrap';

class footer extends React.Component {
     render(){
          return(
          <div className='footer'>
               <Container>
               <Row>
               <Col><div className='left'>Copyright &copy; 2021 Nile Google Developers Club, Abuja</div></Col>
               <COl></COl><div className='right'>Contact us <span><b>Github</b></span> <span><b>Twitter</b></span></div>
               </Row>
               </Container>
              
          </div>
          )
     }
}
export default footer;
